import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the search input field using its ID
    const searchInput = page.locator('#searchInput');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });

    // Type "phone" into the search input to trigger autocomplete
    await searchInput.fill('phone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // Wait for the search suggestions container to appear
    const suggestionsContainer = page.locator('.search-suggestions');
    await suggestionsContainer.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestions_visible.png'));

    // Get all suggestion items and their text content
    const suggestionItems = await page.locator('.suggestion-item').allTextContents();
    if (suggestionItems.length === 0) {
      throw new Error('No search suggestions were displayed.');
    }

    // Select the first suggestion
    const firstSuggestion = page.locator('.suggestion-item').first();
    const firstSuggestionText = await firstSuggestion.textContent();
    await firstSuggestion.click();

    // Verify the search input value is updated with the selected suggestion
    const finalInputValue = await searchInput.inputValue();
    if (finalInputValue !== firstSuggestionText) {
      throw new Error(`Search input value was not updated correctly. Expected: "${firstSuggestionText}", Got: "${finalInputValue}"`);
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_suggestion_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_suggestion_selected.png'));

    return {
      success: true,
      action: "Tested search autocomplete functionality",
      extractedData: {
        appearedSuggestions: suggestionItems,
        selectedSuggestion: firstSuggestionText,
        finalInputValue: finalInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    const errorScreenshots = [];
    try {
        const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorScreenshotPath });
        errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
        // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to test search autocomplete",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
